          <Link to="/details">
            <img src={product.img} alt="product-img" className="card-img-top" />
          </Link>
          <button className="cart-btn" disabled={product.inCart ? true : false}>



          </button>
        </div>
      </div>
    </ProductWrapper >
  );
  console.log(product.inCart);
}

